      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "hardhat/console.sol";

///@notice This Smart Contract is the base of the bottle collections that CoCo is going to have,
///@notice this collections are made to be exchanged when a person collects all the bottle.
///@notice This exchange is going to be made by other smart contract that is the one that is received by the constructor "_exchange"

contract NFTBottlebitsCollection is
    ERC721,
    ERC721URIStorage,
    Pausable,
    AccessControl,
    Ownable
{
    using Strings for uint256;
    using Counters for Counters.Counter;

    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant PAUSE_MINT_MODIFICATOR_ROLE =
        keccak256("PAUSE_MINT_MODIFICATOR_ROLE");
    bytes32 public constant WITHDRAW_MODIFICATOR_ROLE =
        keccak256("WITHDRAW_MODIFICATOR_ROLE");
    bytes32 public constant TOKEN_AND_ADDRESSES_MODIFICATOR_ROLE =
        keccak256("TOKEN_AND_ADDRESSES_MODIFICATOR_ROLE");
    ///@dev this role is the only that can modify the supplies and limits of minting and tokens
    bytes32 public constant LIMIT_MODIFICATOR_ROLE =
        keccak256("LIMIT_MODIFICATOR_ROLE");
    bytes32 public constant URI_MODIFICATOR_ROLE =
        keccak256("URI_MODIFICATOR_ROLE");

    Counters.Counter private _tokenIdCounter;

    uint256 public maxSupply;

    ///@dev this mapping saves the tokens owned by an address
    mapping(address => uint256[]) public ownerTokens;

    string public baseURI;
    string public baseExtension = ".json";

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI,
        uint256 _maxSupply
    ) ERC721(_name, _symbol) {
        _grantRole(DEFAULT_ADMIN_ROLE, _msgSender());
        baseURI = _initBaseURI;
        maxSupply = _maxSupply;
    }

    modifier onlyQuantityAllowed(address account, uint256 quantity) {
        require(
            quantity + _tokenIdCounter.current() <= maxSupply,
            "You are trying to mint more than the limit"
        );
        _;
    }

    function pause() public onlyRole(PAUSE_MINT_MODIFICATOR_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSE_MINT_MODIFICATOR_ROLE) {
        _unpause();
    }

    /// @dev minting of the tokens where the user need to pass the quantity argument
    function safeMint(
        address receiver,
        uint256 quantity
    ) public whenNotPaused onlyRole(MINTER_ROLE) {
        require(quantity > 0, "You need to mint at least 1 NFT");

        for (uint256 i = 0; i < quantity; i++) {
            _tokenIdCounter.increment();
            uint256 tokenId = _tokenIdCounter.current();
            _mint(receiver, tokenId);
            ownerTokens[receiver].push(tokenId);
        }
    }

    /// @dev function created to be used only inside this contract
    function transferOwnerTokens(
        address from,
        address to,
        uint256 tokenId
    ) internal {
        for (uint256 i = 0; i < ownerTokens[from].length; i++) {
            if (ownerTokens[from][i] == tokenId) {
                ownerTokens[to].push(tokenId);
                for (uint256 j = i; j < ownerTokens[from].length - 1; j++) {
                    ownerTokens[from][j] = ownerTokens[from][j + 1];
                }
                ownerTokens[from].pop();
                break;
            }
        }
    }

    /// @dev transfer functions
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public override {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "You have to be approved or owner in order to transfer this token"
        );
        _safeTransfer(from, to, tokenId, _data);
        transferOwnerTokens(from, to, tokenId);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "You have to be approved or owner in order to transfer this token"
        );
        _transfer(from, to, tokenId);
        transferOwnerTokens(from, to, tokenId);
    }

    function _burn(
        uint256 tokenId
    ) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    /// @dev return the URI associated to a tokenId
    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return
            string(
                abi.encodePacked(baseURI, tokenId.toString(), baseExtension)
            );
    }

    function totalSupply() external view returns (uint256) {
        return maxSupply;
    }

    function currentSupply() external view returns (uint256) {
        return _tokenIdCounter.current();
    }

    /// @dev setters of the variables
    function setBaseURI(
        string memory _newBaseURI
    ) public onlyRole(URI_MODIFICATOR_ROLE) {
        baseURI = _newBaseURI;
    }

    function setMaxSupply(
        uint256 _maxSupply
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        maxSupply = _maxSupply;
    }

    function getOwnerTokens(
        address account
    ) public view returns (uint256[] memory) {
        return ownerTokens[account];
    }

    // The following functions are overrides required by Solidity.
    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
"
